#
# TABLE STRUCTURE FOR: absensi
#

DROP TABLE IF EXISTS `absensi`;

CREATE TABLE `absensi` (
  `id_presensi` int NOT NULL AUTO_INCREMENT,
  `pegawai_id` int DEFAULT NULL,
  `status_id` int unsigned DEFAULT NULL,
  `tanggal` date DEFAULT NULL,
  `masuk_std` datetime DEFAULT NULL,
  `pulang_std` datetime DEFAULT NULL,
  `masuk` datetime DEFAULT NULL,
  `pulang` datetime DEFAULT NULL,
  `masuk_ch` datetime DEFAULT NULL,
  `pulang_ch` datetime DEFAULT NULL,
  `jenis` int DEFAULT NULL,
  `libur` int DEFAULT NULL,
  `shift` int DEFAULT NULL,
  `dibayar` int DEFAULT NULL,
  `cuti` int DEFAULT NULL,
  `shift_malam` int DEFAULT NULL,
  `istirahat` decimal(18,2) DEFAULT NULL,
  `lembur` decimal(18,2) DEFAULT NULL,
  `lembur_tetap` decimal(18,2) DEFAULT NULL,
  `lembur_libur` decimal(18,2) DEFAULT NULL,
  `lembur_sabtu` decimal(18,2) DEFAULT NULL,
  `lembur_total` decimal(18,2) DEFAULT NULL,
  `lembur_jenis` int DEFAULT NULL,
  `jamstandar` decimal(18,2) DEFAULT NULL,
  `jamaktual` decimal(18,2) DEFAULT NULL,
  `jamabsent` decimal(18,2) DEFAULT NULL,
  `telat` decimal(18,2) DEFAULT NULL,
  `cepat` decimal(18,2) DEFAULT NULL,
  `foto_masuk` varchar(250) DEFAULT NULL,
  `foto_pulang` varchar(250) DEFAULT NULL,
  `keterangan` varchar(250) DEFAULT NULL,
  `spl` int DEFAULT NULL,
  `validasi` int DEFAULT NULL,
  `validasi_user` varchar(20) DEFAULT NULL,
  `validasi_date` datetime DEFAULT NULL,
  `user_add` varchar(10) DEFAULT NULL,
  `user_ch` varchar(10) DEFAULT NULL,
  `date_add` datetime DEFAULT NULL,
  `date_ch` datetime DEFAULT NULL,
  PRIMARY KEY (`id_presensi`),
  KEY `pegawai_id` (`pegawai_id`),
  KEY `status_id` (`status_id`),
  KEY `tanggal` (`tanggal`),
  KEY `validasi` (`validasi`)
) ENGINE=MyISAM AUTO_INCREMENT=2702 DEFAULT CHARSET=latin1 COMMENT='absensi';



