  `departemen_id` int DEFAULT NULL,
  `seksi_id` int DEFAULT NULL,
  `unit_id` int DEFAULT NULL,
  `level_id` int DEFAULT NULL,
  `jabatan_id` int DEFAULT NULL,
  `ptkp` char(50) DEFAULT NULL,
  `status_kerja` int DEFAULT NULL,
  `nik` varchar(20) DEFAULT NULL,
  `nama` varchar(250) DEFAULT NULL,
  `ktp` varchar(20) DEFAULT NULL,
  `alamat` varchar(250) DEFAULT NULL,
  `daerah` varchar(50) DEFAULT NULL,
  `kota` varchar(50) DEFAULT NULL,
  `kodepos` varchar(20) DEFAULT NULL,
  `telepon` varchar(50) DEFAULT NULL,
  `handphone` varchar(50) DEFAULT NULL,
  `rumah` int DEFAULT NULL,
  `alamat_tinggal` varchar(250) DEFAULT NULL,
  `daerah_tinggal` varchar(50) DEFAULT NULL,
  `kota_tinggal` varchar(50) DEFAULT NULL,
  `kodepos_tinggal` varchar(20) DEFAULT NULL,
  `rumah_tinggal` int DEFAULT NULL,
  `kelamin` int DEFAULT NULL,
  `agama` varchar(50) DEFAULT NULL,
  `warganegara` varchar(50) DEFAULT NULL,
  `lahir_tanggal` date DEFAULT NULL,
  `lahir_tempat` varchar(50) DEFAULT NULL,
  `kawin` int DEFAULT NULL,
  `gol_darah` varchar(20) DEFAULT NULL,
  `jemputan` int DEFAULT NULL,
  `rekening` varchar(20) DEFAULT NULL,
  `rekening_bank` varchar(50) DEFAULT NULL,
  `npwp` varchar(20) DEFAULT NULL,
  `jamsostek` int DEFAULT NULL,
  `jamsostek_no` varchar(20) DEFAULT NULL,
  `kantor` varchar(50) DEFAULT NULL,
  `upah` int DEFAULT NULL,
  `foto` varchar(250) DEFAULT NULL,
  `keterangan` varchar(250) DEFAULT NULL,
  `masuk_tanggal` date DEFAULT NULL,
  `keluar_tanggal` date DEFAULT NULL,
  `keluar_keterangan` varchar(250) DEFAULT NULL,
  `pph` int DEFAULT '0',
  `aktif` int DEFAULT NULL,
  `staff` int DEFAULT NULL,
  `pokok` decimal(18,2) DEFAULT NULL,
  `transport` decimal(18,2) DEFAULT NULL,
  `makan` decimal(18,2) DEFAULT NULL,
  `lembur` decimal(18,2) DEFAULT NULL,
  `lembur_tetap` decimal(18,2) DEFAULT NULL,
  `lembur_libur` decimal(18,2) DEFAULT NULL,
  `bonus` decimal(18,2) DEFAULT NULL,
  `makan_pot` decimal(18,2) DEFAULT NULL,
  `kerja` decimal(18,2) DEFAULT NULL,
  `fungsional` decimal(18,2) DEFAULT NULL,
  `hadir` decimal(18,2) DEFAULT NULL,
  `panel` decimal(18,2) DEFAULT NULL,
  `pokok_stgh` decimal(18,2) DEFAULT NULL,
  `pinjaman` decimal(18,2) DEFAULT NULL,
  `potongan` decimal(18,2) DEFAULT NULL,
  `cicilan` decimal(18,2) DEFAULT NULL,
  `plafon` decimal(18,2) DEFAULT NULL,
  `user_add` varchar(10) DEFAULT NULL,
  `user_ch` varchar(10) DEFAULT NULL,
  `date_add` datetime DEFAULT NULL,
  `date_ch` datetime DEFAULT NULL,
  PRIMARY KEY (`pegawai_id`),
  KEY `pegawai_id` (`pegawai_id`),
  KEY `periode_id` (`periode_id`),
  KEY `departemen_id` (`departemen_id`),
  KEY `seksi_id` (`seksi_id`),
  KEY `unit_id` (`unit_id`),
  KEY `level_id` (`level_id`),
  KEY `jabatan_id` (`jabatan_id`),
  KEY `aktif` (`aktif`),
  KEY `pph` (`pph`),
  KEY `ptkp_id` (`ptkp`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1 COMMENT='pegawai';



