CREATE TABLE `pegawai_upah` (
  `PUpah_ID` int NOT NULL AUTO_INCREMENT,
  `Pegawai_ID` int DEFAULT NULL,
  `Upah_ID` int DEFAULT NULL,
  `ID` int DEFAULT '0',
  `Nama` char(50) DEFAULT NULL,
  `Tipe` int DEFAULT '0',
  `Rumus` int DEFAULT '0',
  `PPH` int DEFAULT '0',
  `Nilai` decimal(18,2) DEFAULT '0.00',
  `JParam` char(50) DEFAULT '0' COMMENT 'Jenis Parameter',
  `NParam` char(50) DEFAULT NULL COMMENT 'Nama Parameter',
  `Kondisi` char(50) DEFAULT NULL COMMENT 'Kondisi Pembanding',
  `Pembanding` char(50) DEFAULT NULL COMMENT 'Pembanding',
  `SParam` char(50) DEFAULT NULL COMMENT 'Satuan Parameter',
  `UParam` char(50) DEFAULT NULL,
